import React, { useState, useEffect} from "react";
import WeatherForecastService from '../service/WeatherForecastService';

function WeatherForecastComponent(props){

    console.log("som vo forecast component")
    console.log("props: " + JSON.stringify(props.history.location.state))

    const [dailyWeatherForecast, setDailyWeatherForecast] = useState(getDailyWeatherForecast.bind(props.history.location.state.lat, props.history.location.state.lon))

    useEffect(() =>{
        console.log("som v useEffect forecast component")
        getDailyWeatherForecast(props.history.location.state.lat, props.history.location.state.lon)
    })
    return;
}

const getDailyWeatherForecast = (lat, lon) => {
    WeatherForecastService.getDailyForecastByCityName.bind(lat, lon, "Hourly,Current")
}
export default WeatherForecastComponent
